import React from "react";
import Avatar from "@mui/material/Avatar";
import { Link } from "react-router-dom";
import { Button, IconButton } from "@mui/material";
import SettingsIcon from "@mui/icons-material/Settings";
import EditIcon from "@mui/icons-material/Edit";
import BookmarkIcon from "@mui/icons-material/Bookmark";
import PhotoCameraIcon from "@mui/icons-material/PhotoCamera";
import BoltIcon from "@mui/icons-material/Bolt";

import "./Profile.css";

function Profile({ name, age, profilePic,job }) {
  return (
    <div class="profile">
      <Avatar
        sx={{ height: "90px", width: "90px" }}
        className="profile__image"
        alt={name}
        src={profilePic}
      />
      <div class="profile__info">
      <h2>
        {name}, {age}
      </h2>
      <p>
        {job}
      </p>
      </div>
    </div>
  );
}

function Profiles() {
  return (
    <div class="profiles__page">
      <Profile
        name="Harry Alpha"
        age="23"
        profilePic="http://www.venmond.com/demo/vendroid/img/avatar/big.jpg"
        job="Front-End Developer at Tinder"
      />
      <div className="profile__buttons">
        <IconButton className="profile__settings">
          <SettingsIcon fontSize="large" />
        </IconButton>
        <label>Settings</label>
        <IconButton className="profile__edit">
          <EditIcon fontSize="large" />
        </IconButton>
        <label>Edit Profile</label>
      </div>

      <div className="profile__aspects">
        <div className="profile__upgrades">
          <BoltIcon fontSize="large" className="profile__bolt" />
          <h2>Get Matches Faster</h2>
        </div>
        <p>Boost your profile once per month!</p>
        <Button>GET TINDER PLUS</Button>
      </div>
    </div>
  );
}

export default Profiles;
